import React from "react";

const Header = ({ props, length }) => {
  return (
    <header>
      <h1>{props.tittle}</h1>
      <div>
        <p>
          {length > 1 ? "Lists" : "List"}-{length}
        </p>
      </div>
    </header>
  );
};

Header.defaultProps = {
  tittle: "vinish",
};
export default Header;
